import React from 'react';
import Slider from 'react-slick';
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

// Example project data, replace with your own data
const projects = [
    {
        title: "Provenance Security",
        description: "Website for cybersecurity startup Provenance Security",
        imageUrl: "https://via.placeholder.com/300",
    },
    {
        title: "Project 2",
        description: "Description of Project 2",
        imageUrl: "https://via.placeholder.com/300",
    },
    {
        title: "Project 3",
        description: "Description of Project 3",
        imageUrl: "https://via.placeholder.com/300",
    },
];

const Projects = () => {
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1,
    };

    return (
        <section id="projects-section">
            <div className="container px-5 py-10 mx-auto">
                <div className="text-center mb-20">
                    <h1 className="sm:text-4xl text-3xl font-medium title-font text-white mb-4">
                        Projects
                    </h1>
                </div>
                <Slider {...settings}>
                    {projects.map((project, index) => (
                        <div key={index} className="project-slide">
                            <div className="grid grid-cols-2 gap-4">
                                <div className="project-image">
                                    <img src={project.imageUrl} alt={project.title} className="custom-image-size" />
                                </div>
                                <div className="project-text">
                                    <h2 className="text-2xl font-semibold text-white mb-2">{project.title}</h2>
                                    <p className="text-white">{project.description}</p>
                                </div>
                            </div>
                        </div>
                    ))}
                </Slider>
            </div>
        </section>
    );
};

export default Projects;
